l�usula 4�.</strong> Se houver algum dano ao im�vel, o LOCAT�RIO arcar�, al�m da multa prevista, com todas as despesas oriundas da repara��o do dano causado.��� ����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 5�.</strong> O LOCAT�RIO poder� usufruir o im�vel durante (.....) ano (s) a contar da data de entrega das chaves pelo LOCADOR.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������ � � �</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>DAS BENFEITORIAS E CONSTRU��ES </strong></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">�� �������������������� ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 6�.</strong> Qualquer benfeitoria ou constru��o que seja destinada ao im�vel objeto deste, dever�, de imediato, ser submetida � autoriza��o expressa do LOCADOR.�����</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">���� ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 7�.</strong> Vindo a ser feita benfeitoria, faculta ao LOCADOR aceit�-la ou n�o, restando ao LOCAT�RIO, em caso do LOCADOR n�o aceit�-la, modificar o im�vel para que fique da maneira como lhe foi entregue.����������� ����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 8�.</strong> As benfeitorias, consertos ou reparos far�o parte integrante do im�vel, n�o assistindo ao LOCAT�RIO o direito de reten��o ou indeniza��o sobre a mesma.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� ������ � �</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>DO VALOR A SER PAGO</strong></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">�� � ������ ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 9�.</strong> Pela loca��o, o LOCAT�RIO pagar� o valor de R$ (....) (Valor expresso), sempre at� o (.....) dia �til de cada m�s, mediante dep�sito em conta corrente indicada pelo LOCADOR.��� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\">�</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Par�grafo �nico. Ocorrendo atraso no pagamento do aluguel, o LOCAT�RIO dever� pagar uma multa de (.....)% ao dia, calculada sobre o valor do aluguel.����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 10�.</strong> O valor do aluguel ser� reajustado anualmente, tendo como base, os �ndices previstos e acumulados no per�odo anual, por exemplo, (IGPM ou IGP ou IPC, etc.) ou, em caso de falta deste �ndice, o reajustamento do aluguel ter� por base a m�dia da varia��o dos �ndices inflacion�rios do ano corrente ao da execu��o do aluguel, at� o primeiro dia anterior ao pagamento do aluguel.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Par�grafo �nico. Ocorrendo alguma mudan�a no �mbito governamental, todos os valores agregados ao aluguel, bem como o pr�prio aluguel, ser�o revistos pelas partes.���� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 11.</strong> O LOCAT�RIO se compromete ainda a efetuar em dia o pagamento dos encargos tribut�rios que incidam ou venham a incidir sobre o im�vel, bem como todas as despesas ligadas direta ou indiretamente com a conserva��o do im�vel, tais como �gua, luz, telefone, condom�nio, etc.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� ������ � � <strong>�</strong></span></p>\r\n<h2 style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">DAS OBRIGA��ES DO LOCADOR</span><br style=\"margin:2px 0;\" /><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">��������������������������� </span></h2>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 12.</strong> O LOCADOR dever� entregar as chaves ao LOCAT�RIO no dia (....) da assinatura deste contrato.�</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">��� ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 13.</strong> O LOCADOR afirma estar o im�vel em perfeitas condi��es de uso, como comprovado mediante termo de vistoria.����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Par�grafo �nico. Caso o im�vel n�o corresponda �s condi��es tratadas no caput da presente cl�usula, haver� rescis�o imediata do contrato e pagamento de indeniza��o pelo LOCADOR ao LOCAT�RIO, no valor de (....)% sobre o valor da loca��o.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������������� � � �</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>DAS OBRIGA��ES DO LOCAT�RIO</strong>� </span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������ �