></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� � � �</span></p>\r\n<h2 style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">DO DIREITO DE PREFER�NCIA�</span></h2>\r\n<h2 style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"> � ����� <br /></span></h2>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 18.</strong> O LOCAT�RIO se compromete a desocupar o im�vel no prazo de (.....) dias ap�s o t�rmino da loca��o, devolvendo as chaves ao LOCADOR.� �</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">��� � ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Par�grafo �nico. Caso permane�a no im�vel ap�s o prazo determinado no caput da presente cl�usula, o LOCAT�RIO pagar� multa de R$ (....) (Valor expresso) por dia em que permanecer em posse do im�vel e respectivas chaves.��� </span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 19.</strong> O LOCADOR, em qualquer tempo, poder� alienar o im�vel, mesmo durante a vig�ncia do contrato de loca��o e, por via de conseq��ncia, ceder os direitos contidos no contrato.���� �����</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"> <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 20.</strong> O LOCADOR dever� notificar o LOCAT�RIO para que este possa exercer seu direito de prefer�ncia na aquisi��o do im�vel, nas mesmas condi��es e