odos os encargos e obriga��es dispostas no presente instrumento.�����</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">�������� ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 23.</strong> Os FIADORES renunciam expressamente aos benef�cios contidos nos artigos 827, 834, 835, 837 e 838 do Novo C�digo Civil (Lei n� 10.406 de 10/01/2002).</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������������ ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 24.</strong> Os FIADORES n�o se eximir�o de responsabilidade solid�ria, caso o contrato venha a ultrapassar seu prazo de vig�ncia, tornando-se desta forma, contrato por prazo indeterminado, desde que previamente comunicada a prorroga��o do contrato aos fiadores, os quais dever�o anuir para manuten��o da fian�a prestada.��</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">���� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Par�grafo �nico. Caso os fiadores n�o concordem com a perman�ncia da fian�a, a prorroga��o do prazo de vig�ncia do contrato depender� da substitui��o dos mesmos por outros fiadores, sob pena de restar rescindido o contrato por decurso do prazo estipulado na cl�usula 24.������������ ����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 25.</strong> Casos os FIADORES venham a incorrer em concordata, fal�ncia ou em comprovado estado de insolv�ncia, o LOCAT�RIO dever� substitu�-lo em (....) dias, sob pena de rescis�o contratual.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt