esta��o contr�ria do LOCADOR. (3)</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������ � � �</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>DA CONDI��O GERAL </strong></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� � � � ������������� ������</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 28.</strong> O LOCAT�RIO n�o poder�, sem expressa autoriza��o do LOCADOR, emprestar ou sublocar o im�vel bem como os m�veis a terceiros.</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� ������ � � ������ � �</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>DO FORO </strong></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� � �������������� � � � ����</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\"><strong>Cl�usula 29.</strong> Para dirimir quaisquer controv�rsias oriundas do CONTRATO, as partes elegem o foro da comarca de (....................).�����</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">���������������������������� ����� <br /></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Por estarem assim justos e contratados, firmam o presente instrumento, em duas vias de igual teor, juntamente com 2 (duas) testemunhas.��������</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">���������� �������������������� ����� <br /></span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">(Local, data e ano).</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������������� ������� ������ ������</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">(Nome e assinatura do LOCADOR)</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������������� ������</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">(Nome e assinatura do Locat�rio)</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">�������������������� ������</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">(Nome, RG e assinatura da Testemunha 1)</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������������� ������</span></p>\r\n<p><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">(Nome, RG e assinatura da Testemunha 2)</span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������ � ������</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>Nota</strong></span></p>\r\n<p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� �� ����</span></p>\r\n<ol><li><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Os Contratos de Loca��o de Im�veis regem-se pela Lei n� 8.245/91.</span></li>\r\n</ol><p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">������ ������</span></p>\r\n<ol start=\"2\"><li><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Determina��o contida no art. 46 da Lei n� 8.245/91, o qual trata das loca��es ajustadas por escrito e por prazo igual ou superior a trinta meses. � necess�rio observar a possibilidade, contida no art. 47 da citada lei, de a loca��o ocorrer por prazo inferior a 30 meses.</span></li>\r\n</ol><p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� ������</span></p>\r\n<ol start=\"3\"><li><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">Determina��o do � 1� do art. 46 da Lei n� 8.245/91, referente a prorroga��o do contrato quando a loca��o for estipulada por prazo igual ou superior a trinta meses. J� o art. 47 da citada lei determina que nos contratos por prazo inferior a 30 meses, findo o prazo estabelecido, a loca��o prorroga-se automaticamente, somente podendo ser retomado o im�vel nos casos especificados no mesmo artigo.</span></li>\r\n</ol><p style=\"margin:2px 0;\"><span style=\"font-size:12pt;font-family:arial, helvetica, sans-serif;\">� �</span></p>'),
(5, 'CONTRATO DE LOCA��O RESIDENCIAL SEM GARANTIA', '', '<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>IDENTIFICA��O DAS PARTES CONTRATANTES</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>LOCADOR:</strong> (Nome do Locador),(Nacionalidade), (Profiss�o), (Estado Civil), Carteira de Identidade n� (xxx), C.P.F. n� (xxx), residente e domiciliado na Rua (xxx), n.� (xxx), bairro (xxx), cidade (xxx), Cep. (xxx), no Estado (xxx), e sua esposa (Nome), (Nacionalidade), (Profiss�o), Carteira de Identidade n� (xxx), C.P.F. n� (xxx), ambos capazes;</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>�</strong></span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>LOCAT�RIO:</strong> (Nome do Locat�rio), (Nacionalidade), (Profiss�o), (Estado Civil), Carteira de Identidade n� (xxx), C.P.F. n� (xxx), capaz, residente e domiciliado na Rua (xxx), n.� (xxx), bairro (xxx), cidade (xxx), Cep. (xxx), no Estado (xxx), e sua esposa (xxx), (Nacionalidade), (Profiss�o), Carteira de Identidade n� (xxx), C.P.F. n� (xxx); juntamente com seus:</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong><em>As partes acima identificadas t�m, entre si, justo e acertado o presente Contrato de Loca��o Residencial sem garantia locat�cia, que se reger� pelas cl�usulas seguintes e pelas condi��es de pre�o, forma e termo de pagamento descritas no presente.</em></strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO OBJETO DO CONTRATO</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 1�.</strong> O presente, tem como OBJETO, o im�vel de propriedade do <strong>LOCADOR</strong>, situado na Rua (xxx), bairro (xxx), cidade (xxx), Cep (xxx),