rif;font-size:12pt;\"> <strong>Cl�usula 4�.</strong> Qualquer benfeitoria ou constru��o que seja destinada ao im�vel objeto deste, dever� de imediato, ser submetida a autoriza��o expressa do <strong>LOCADOR</strong>. Vindo a ser feita benfeitoria, faculta ao <strong>LOCADOR</strong> aceit�-la ou n�o, restando ao <strong>LOCAT�RIO</strong> em caso do <strong>LOCADOR</strong> n�o aceit�-la, modificar o im�vel da maneira que lhe foi entregue. As benfeitorias, consertos ou reparos far�o parte integrante do im�vel, n�o assistindo ao <strong>LOCAT�RIO</strong> o direito de reten��o ou indeniza��o sobre a mesma.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DA DEVOLU��O DO IM�VEL FINDO PRAZO DA LOCA��O</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 5�.</strong> O <strong>LOCAT�RIO</strong> restituir� o im�vel locado nas mesmas condi��es as quais o recebeu, quais sejam, pintado com tinta l�tex na cor contida no auto de vistoria, sendo que as instala��es el�tricas, hidr�ulicas e acess�rios dever�o tamb�m, estar em perfeitas condi��es de funcionamento, salvo as deteriora��o decorrentes do uso normal e habitual do im�vel.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Par�grafo �nico.</strong> Os autos de vistoria inicial e final, que far�o parte deste contrato conter�o assinatura de duas testemunhas, dos contratantes, dos fiadores e de um engenheiro civil.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO CONDOM�NIO</strong></span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>�</strong></span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>Cl�usula 6�.</strong> Fica desde j� ciente o <strong>LOCAT�RIO</strong> que, em caso de edif�cio onde haja condom�nio, restar� o mesmo obrigado por todas as cl�usulas constantes na Conven��o e no Regulamento Interno existente.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO DIREITO DE PREFER�NCIA E VISTORIAS ESPOR�DICAS</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 7�.</strong> Caso o <strong>LOCADOR</strong> manifeste vontade de vender o im�vel objeto do presente, dever� propor por escrito ao <strong>LOCAT�RIO</strong> que se obrigar� a emitir a resposta em 30 (trinta) dias, a partir da comunica��o inicial.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 8�.</strong> O <strong>LOCAT�RIO</strong> permitir� ao <strong>LOCADOR</strong>, realizar vistorias no im�vel em dia e hora a serem combinados, podendo este �ltimo averiguar o funcionamento de todas as instala��es e acess�rios. Constatando-se algum v�cio que possa afetar a estrutura f�sica do im�vel ficar� compelido o <strong>LOCAT�RIO</strong> a realizar o conserto, no prazo de (xxx) dias. N�o ocorrendo o conserto, o <strong>LOCADOR</strong> ficar� facultado a RESCINDIR O CONTRATO, sem preju�zo dos numer�rios previstos neste.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 9�.</strong> O <strong>LOCAT�RIO</strong> n�o se manifestando no prazo estipulado, contido no caput desta cl�usula, permitir� desde logo ao <strong>LOCADOR</strong>, vistoriar o im�vel com poss�veis pretendentes.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DOS ATOS DE INFORMA��O ENTRE OS CONTRATANTES</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 10�.</strong> As partes integrantes deste contrato ficam desde j� acordadas a se comunicarem somente por escrito, atrav�s de qualquer meio admitido em Direito. Na aus�ncia de qualquer das partes, as mesmas se comprometem desde j� a deixarem nomeados procuradores, respons�veis para tal fim.</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>�</strong></span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>DO SEGURO CONTRA INC�NDIO E OUTRAS PROVID�NCIAS</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 11�.</strong> O <strong>LOCAT�RIO</strong> fica desde j� obrigado a fazer seguro contra inc�ndios, do im�vel locado, em seguradora id�nea e que passe por pr�via autoriza��o do <strong>LOCADOR</strong>.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 12�.</strong> Qualquer acidente que porventura venha a ocorrer no im�vel por culpa ou dolo do <strong>LOCAT�RIO</strong>, o mesmo ficar� obrigado a pagar, al�m da multa prevista na Cl�usula 18�, todas as despesas por danos causados ao im�vel, devendo restitu�-lo no estado cujo encontrou e que, sobretudo, teve conhecimento no auto de vistoria.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO VALOR DO ALUGUEL, REAJUSTE, DAS DESPESAS E TRIBUTOS</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 13�.</strong> Como aluguel mensal, o <strong>LOCAT�RIO</strong> se obrigar� a pagar o valor de R$ (xxx) (Valor Expresso), a ser efetuado diretamente ao <strong>LOCADOR</strong>, e na sua aus�ncia ficar� autorizado a receb�-lo seu procurador (xxx), (Nacionalidade), (Profiss�o), (Estado Civil), Carteira de Identidade n� (xxx), C.P.F. n� (xxx), capaz, residente e domiciliado na Rua (xxx), n.� (xxx), bairro (xxx), cidade (xxx), Cep. (xxx), no Estado (xxx). Devendo faz�-lo, nos termos do Art. 42 da Lei 8.245/91, at� o sexto dia �til do m�s vincendo, sob pena de multa, corre��es e despesas previstas nas Cl�usulas 17� e 18�.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 14�.</strong> Fica obrigado o <strong>LOCADOR</strong> ou seu procurador, a emitir recibo da quantia paga, relacionando pormenorizadamente todos os valores oriundos de juros, ou outra despesa. Emitir-se-� tal recibo, desde que haja a apresenta��o pelo <strong>LOCAT�RIO</strong>, dos comprovantes de todas as despesas do im�vel devidamente quitadas. Caso o <strong>LOCAT�RIO</strong> venha a efetuar o pagamento do aluguel atrav�s de cheque, restar� facultado ao <strong>LOCADOR</strong> emitir os recibos de pagamento somente ap�s compensa��o do mesmo.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 15�.</strong> O valor do aluguel ser� reajustado anualmente, tendo como base, os �ndices previstos e acumulados no per�odo anual do (IGPM ou IGP ou IPC, etc), em caso de falta deste �ndice, o reajustamento do aluguel ter� por base a m�dia da varia��o dos �ndices inflacion�rios do ano corrente ao da execu��o do aluguel, at� o primeiro dia anterior ao pagamento de todos os valores devidos. Ocorrendo alguma mudan�a no �mbito governamental, todos os valores agregados ao aluguel, bem como o pr�prio aluguel, ser�o revistos pelas partes.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 16�.</strong> Faculta ao <strong>LOCADOR</strong> ou � seu procurador, cobrar do <strong>LOCAT�RIO</strong>, o(s) aluguel(�is), tributo(s) e despesa(s) vencido(s), oriundo(s) deste contrato, utilizando-se de todos os meios legais admitidos.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Par�grafo �nico.</strong> O(s) cheque(s) utilizado(s) em pagamento, se n�o compensado(s) at� o quinto dia �til contados a partir do vencimento do aluguel, ocasionar�(�o) mora do <strong>LOCAT�RIO</strong>, facultando ao <strong>LOCADOR</strong> a aplica��o do disposto na Cl�usula 18�.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 17�.</strong> Todas as despesas diretamente ligadas � conserva��o do im�vel, tais como, �gua, luz, g�s, telefone, as condominiais que estejam relacionadas ao uso do mesmo, bem como os tributos, ficar�o sob a responsabilidade do <strong>LOCAT�RIO</strong>, ressalvando-se quanto � contribui��o de melhoria.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DA MULTA E DO ATRASO NO PAGAMENTO</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 18�.</strong> O <strong>LOCAT�RIO</strong>, n�o vindo a efetuar o pagamento do aluguel at� a data estipulada na Cl�usula 13�, fica obrigado a pagar multa de 10% (dez por cento) sobre o valor do aluguel estipulado neste contrato, bem como juros de mora de 1%(um por cento) ao m�s, mais corre��o monet�ria.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 19�.</strong> Em caso de atraso no pagamento dos alugu�is e n�o compensando o cheque destinado para tal fim, restar� em mora o <strong>LOCAT�RIO</strong>, ficando responsabilizado por todos os pagamentos previstos neste atraso, sem preju�zo do pagamento da multa, juros de mora e corre��o monet�ria. N�o configurar�o nova��o ou adi��o �s cl�usulas contidas no presente instrumento, os atos de mera toler�ncia referentes ao atraso no pagamento do aluguel ou quaisquer outros tributos.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO DESCONTO</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 20�.</strong> O <strong>LOCAT�RIO</strong> ter� desconto de R$ (xxx) (Valor Expresso) caso pague o valor do aluguel previsto neste contrato at� o 1� dia �til do m�s subsequente ao vencido.</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>�</strong></span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"><strong>DA TOLER�NCIA</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 21�.</strong> O <strong>LOCAT�RIO</strong> ter� um prazo de toler�ncia para efetuar o pagamento do aluguel at� o 2� (segundo) dia �til ap�s o vencimento, caso n�o seja dia �til, ficar� obrigado desde j� a efetuar o pagamento no primeiro dia �til subsequente a esta data.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DA MULTA POR INFRA��O</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 22�.</strong> As partes estipulam o pagamento da multa no valor de 03 (tr�s) alugu�is vigentes a �poca da ocorr�ncia do fato, a ser aplicada �quele que venha a infringir quaisquer das cl�usulas contidas neste contrato exceto quando da ocorr�ncia das hip�teses previstas na Cl�usula 23�.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DA RESCIS�O CONTRATUAL</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 23�.</strong> Ocorrer� a rescis�o do presente contrato, independente de qualquer comunica��o pr�via ou indeniza��o por parte do <strong>LOCADOR</strong>, quando:</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\">�</span></p>\r\n<ol><li><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\">a) Ocorrendo qualquer sinistro, inc�ndio ou algo que venha a impossibilitar a posse do im�vel, independente de dolo ou culpa do <strong>LOCAT�RIO</strong>; bem como quaisquer outras hip�teses que maculem o im�vel de v�cio e impossibilite sua posse;</span></li>\r\n</ol><p><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\">�</span></p>\r\n<ol><li><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\">b) Em hip�tese de desapropria��o do im�vel alugado.</span></li>\r\n</ol><p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 24�.</strong> Caso o im�vel seja utilizado de forma diversa da loca��o residencial, restar� facultado ao <strong>LOCADOR</strong>, rescindir o presente contrato de plano, sem gerar direito a indeniza��o ou qualquer �nus por parte deste �ltimo. Sem preju�zo da obriga��o do <strong>LOCAT�RIO</strong> de efetuar o pagamento das multas e despesas previstas na Cl�usula 18�. Salvo autoriza��o expressa do <strong>LOCADOR</strong>.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO PRAZO DE LOCA��O</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 25�.</strong> A presente loca��o ter� o lapso temporal de validade de (xxx) meses, a iniciar-se no dia (xxx), do m�s (xxx) no ano de (xxx) e findar-se no dia (xxx), do m�s (xxx) no ano de (xxx), data a qual o im�vel dever� ser devolvido nas condi��es previstas na Cl�usula 5�, efetivando-se com a entrega das chaves, independentemente de aviso ou qualquer outra medida judicial ou extrajudicial.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DA PRORROGA��O DO CONTRATO</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 27�.</strong> Ultrapassando o contrato, a data prevista, ou seja, tornando-se contrato por tempo indeterminado, poder� o <strong>LOCADOR</strong>, rescindi-lo a qualquer tempo, desde que ocorra notifica��o por escrito ao <strong>LOCAT�RIO</strong>, que ficar� compelido a sair do im�vel dentro do prazo de 30 (trinta) dias, a contar do recebimento da notifica��o. Ocorrendo prorroga��o, o <strong>LOCAT�RIO</strong> e o <strong>LOCADOR</strong> ficar�o obrigados por todo o teor deste contrato.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DISPOSI��ES GERAIS</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 28�.</strong> Os herdeiros, sucessores ou cession�rios das partes contratantes se obrigam desde j� ao inteiro teor deste contrato.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 29�.</strong> Este contrato deve ser registrado no Cart�rio de Registro Imobili�rio.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>DO FORO</strong></span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> <strong>Cl�usula 30�.</strong> O presente contrato passa a vigorar entre as partes a partir da assinatura do mesmo, as quais elegem o foro da cidade de (xxx), onde se situa o im�vel, para dirimirem quaisquer d�vidas provenientes da execu��o e cumprimento do mesmo;</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> Por estarem, assim justos e contratados, firmam o presente instrumento, em duas vias de igual teor, juntamente com 2 (duas) testemunhas.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> Local, data e ano.</span></p>\r\n<p><br /><span style=\"font-family:arial, helvetica, sans-serif;font-size:12pt;\"> LOCADOR</span></p>\r\n<p><span style=\"font-family:arial, helvetica, sans-serif;font-size